import React from 'react';
import "./styles.css";
import Navbar from '../src/components/Navbar';

export default function App() {
  return (
    <div>
      <Navbar />
    <div className="App">
     <h1>Hello Codealo</h1> 
     <h2>Start editing to see some magic happen!</h2>
    </div> 
    </div>
  );
}
